// src/pages/NovoAdmin.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

const niveis = ['super', 'admin', 'moderador'];

export default function NovoAdmin() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    email: '',
    senha: '',
    nivelAcesso: 'admin',
    ativo: true,
  });
  const [errors, setErrors] = useState({});

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    setForm(f => ({ ...f, [name]: type === 'checkbox' ? checked : value }));
    setErrors(errs => ({ ...errs, [name]: null }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      await api.post('/admin', form);
      navigate('/pets'); // ou redirecionar para uma rota como "/admin/lista"
    } catch (err) {
      const resp = err.response?.data;
      if (resp?.erros) {
        const fieldErrors = resp.erros.reduce(
          (acc, cur) => ({ ...acc, [cur.path]: cur.msg }),
          {}
        );
        setErrors(fieldErrors);
      } else {
        setErrors({ form: resp?.erro || 'Erro ao cadastrar admin' });
      }
    }
  };

  return (
    <div className="container my-5">
      <h2>Cadastrar Novo Admin</h2>
      <Link to="/pets" className="btn btn-link mb-3">← Voltar</Link>

      {errors.form && (
        <div className="alert alert-danger">{errors.form}</div>
      )}

      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label className="form-label">Nome</label>
          <input
            name="nome"
            className="form-control"
            value={form.nome}
            onChange={handleChange}
          />
          {errors.nome && <div className="text-danger">{errors.nome}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Email</label>
          <input
            name="email"
            type="email"
            className="form-control"
            value={form.email}
            onChange={handleChange}
          />
          {errors.email && <div className="text-danger">{errors.email}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Senha</label>
          <input
            name="senha"
            type="password"
            className="form-control"
            value={form.senha}
            onChange={handleChange}
          />
          {errors.senha && <div className="text-danger">{errors.senha}</div>}
        </div>

        <div className="mb-3">
          <label className="form-label">Nível de Acesso</label>
          <select
            name="nivelAcesso"
            className="form-select"
            value={form.nivelAcesso}
            onChange={handleChange}
          >
            {niveis.map(n => (
              <option key={n} value={n}>{n}</option>
            ))}
          </select>
          {errors.nivelAcesso && <div className="text-danger">{errors.nivelAcesso}</div>}
        </div>

        <div className="form-check mb-3">
          <input
            type="checkbox"
            name="ativo"
            className="form-check-input"
            checked={form.ativo}
            onChange={handleChange}
          />
          <label className="form-check-label">Ativo</label>
        </div>

        <button type="submit" className="btn btn-primary">Cadastrar Admin</button>
      </form>
    </div>
  );
}
